package com.testwa.distest.account;import org.springframework.boot.SpringApplication;import org.springframework.boot.autoconfigure.SpringBootApplication;import org.springframework.cache.annotation.EnableCaching;import org.springframework.context.annotation.EnableAspectJAutoProxy;import org.springframework.scheduling.annotation.AsyncConfigurerSupport;import org.springframework.scheduling.annotation.EnableAsync;import org.springframework.scheduling.annotation.EnableScheduling;/** * @Program: distest-account * @Description: 账户管理模块启动类 * @Author: wen * @Create: 2018-04-11 11:39 **/@SpringBootApplication@EnableScheduling@EnableCaching@EnableAsync@EnableAspectJAutoProxy(proxyTargetClass = true)public class DistestAccountApplication extends AsyncConfigurerSupport {    public static void main(String[] args) {        SpringApplication.run(DistestAccountApplication.class, args);    }}